import React from 'react';
import './App.css';
import CalendarComponent from './components/CalendarComponent';
import DigitalCollage from './components/DigitalCollage';
import PetInteraction from './components/PetInteraction';
import StickyNoteBoard from './components/StickyNoteBoard';
import Whiteboard from './components/Whiteboard';
import PhotoUpload from './components/PhotoUpload';
import TrickSection from './components/TrickSection';
import PetPhotosSection from './components/PetPhotosSection';
import WeeklySchedule from './components/WeeklySchedule';
import StatusUpdate from './components/StatusUpdate';

function App() {
  return (
    <div className="App">
      <h1>Our Relationship Site</h1>
      <marquee className="marquee">Welcome to our early 2000s inspired space! ðŸŒŸ</marquee>
      <StatusUpdate />
      <CalendarComponent />
      <WeeklySchedule />
      <DigitalCollage />
      <PetInteraction />
      <StickyNoteBoard />
      <Whiteboard />
      <PhotoUpload />
      <TrickSection />
      <PetPhotosSection />
    </div>
  );
}

export default App;
